import React from "react";

const Item = (props) => {
  return (
    <>
      <div>
        <p>{props.title}</p>
        <p>{props.id}</p>
        <p>{props.amount}</p>
        <p>{props.createdAt}</p>
        <p>{props.type}</p>
      </div>
    </>
  );
};
export default Item;
